// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

import "./PriceConventer.sol";

error NotOwner();

contract FundMe {
    using PriceConverter for uint256;

    mapping(address => uint256) public adressToAmountFunded;

    address[] public funders;

    address public /* immutable */ i_owner;
    // uint256 public constant MINIMUM_USD = 50 * 10 * 18;
    uint256 public constant MINIMUM_USD = 5e18;

    constructor(){
        i_owner = msg.sender;
    }

    function fund()public payable{
        require(msg.value.getConversionRate() >= MINIMUM_USD,"NOT ENOUGH ETH SPENT");

        adressToAmountFunded[msg.sender] += msg.value;
        funders.push(msg.sender);

    }

    function getVersion() public view returns (uint256){
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        return priceFeed.version();
    }

    modifier onlyOwner{
        if(msg.sender != i_owner) revert NotOwner();
        _;
    }

    function withdraw() payable onlyOwner public{
        for (uint256 funderIndex=0; funderIndex < funders.length; funderIndex++){
            address funder = funders[funderIndex];
            adressToAmountFunded[funder] = 0;
        }
    }

    fallback() external payable {
        fund();
    }

    receive() external payable {
        fund();
    }

}

